description:
NGAY GIỮA CẦU CHUI - VŨ ĐỨC THẬN - 2 MẶT TIỀN - PHÂN LÔ - MẶT PHỐ QUYỀN LỰC - KINH DOANH VÔ ĐỊCH- ĐƯỜNG TO VỈA HÈ RỘNG VỊ TRÍ ĐẸP NHẤT PHỐ - SỔ VUÔNG VẮN - KO LỖI PHONG THỦY
- Nhà 2 mặt tiền, vị trí mặt phố Ngô Gia Tự đoạn đẹp nhất phố, đoạn giữa Cầu Chui - Vũ Đức Thận, vỉa hè rộng đá bóng, xung quanh nhiều Ngân hàng, VP Công ty thuê, mặt đường lớn, ô tô dừng đỗ ngày đêm;
- Nhà nằm ở vị trí đẹp nhất phố Ngô Gia Tự. Hiện trạng nhà C4 , đang cho thuê kinh doanh 30 triệu/ tháng;
- Nhà nằm mặt tuyến phố lớn, kinh doanh đa nghành nghề, gần BV Đức Giang, BV Đa khoa Quốc Tế Bắc Hà, BV Tâm Anh, Trường Quốc tế WSD, gần Cơ quan hành chính quận Long Biên, 5 phút sang phố cổ Hồ Gươm, tiện ích xung quanh bạt ngàn không thiếu thứ gì;
- Phố Ngô Gia Tự thông thương với các tuyến phố lớn: Nguyễn Văn Cừ, Vũ Đức Thận, Hồng Tiến; Hoàng Như Tiếp; Ngọc Lâm; Nguyễn Sơn;
- Pháp lý: Sổ đỏ vuông đẹp, sẵn sàng giao dịch;
- Giá: 32 (có thương lượng cho khách thiện chí);
